def ternary_entropyf(pP1, pM1):
    eps = 1e-7 # I just choose this value for fp16 safety..

    p0 = 1 - pP1 - pM1
    P = np.array([p0, pP1, pM1]).T

    H = -P*np.log2(P)
    H[
        (P<eps) |
        (P > 1-eps)
    ] = 0
    return H.sum()
